def movingAverage(array, c):

    fast = {}
    slow = {}
    signal = {}
    bmReturns = {}
    sReturns = {}
    cBmReturns = 0
    cSReturns = 0

    nFast = 9
    nSlow = 90

    for i in range(199, len(array[c])-1):
        fast[i] = average(array[c], nFast, i)
        slow[i] = average(array[c], nSlow, i)
        if fast[i] > slow[i]:
            signal[i] = 1
        else:
            signal[i] = -1
        bmReturns[i] = ((array[c] [i]/array[c] [i-1]) - 1) * 100

    for i in range(200, len(array[c])-1):
        sReturns[i] = bmReturns[i] * signal [i-1]
        cBmReturns += bmReturns[i]
        cSReturns += sReturns[i]

    print("Benchmark: " + str(cBmReturns) + " %")
    print("Strategy: " + str(cSReturns) + " %")

movingAverage(array, 1)
print(len(array[1]))
